import { Box, Card, Grid, GridItem, Heading } from "@chakra-ui/react";

export default function CancionItem() {
    return (
        <Box position="relative" w="100%">
            <Card h="10vh" w="100%" minWidth="205px" minHeight="70px" borderRadius="35px" p={4}>
                <Grid templateColumns='repeat(10, 1fr)' gap={1}>
                    <GridItem colSpan={2} h={2} bg='tomato' />
                    <GridItem colSpan={8} h={2} bg='papayawhip' />
                </Grid>
            </Card>
        </Box>
    );
}
